webpackJsonp([0xe2fe348e3536],{6405:function(e,t){e.exports={data:{post:{html:"<p>We're back from Cologne. Christopher loved Phantasialand. We told him that we would be staying at the Dragon City (which he knows from Jim Knopf), since the hotel had a Chinese theme, and he was able to find plenty of dragons. At the park itself, he had to ride the monorail 4 times to see the (machanized) mammoth and dinosaurs.</p>\n<p>On the way back, we stopped at the cathedral in Cologne just to see some architecture that's not part of a theme park. And we did not stop at the chocolate museum. Maybe next time.</p>",fields:{title:"We're Back",date:"30 Sep 2003",url:"https://papascott.de/2003-09-30-were-back/"}}},pathContext:{slug:"/2003-09-30-were-back/",prev:{fields:{title:"AL Playoffs: Twins 3 Yankees 1",date:"30 Sep 2003",slug:"/2003-09-30-al-playoffs-twins-3-yankees-1/"}},next:{fields:{title:"Best Practices for Time Travelers",date:"01 Oct 2003",slug:"/2003-10-01-best-practices-for-time-travelers/"}}}}}});
